import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import FeatureList from './components/FeatureList';
import Navbar from './components/Navbar';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={
          <>
          <Navbar/>
        <FeatureList/>
        </>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
